    <style rel="stylesheet" crossorigin>:root{--epsic-blue: #003f87;--bg-color: #f8f9fa;--card-bg: #ffffff;--border-color: #dee2e6;--text-color: #333333}*{box-sizing:border-box;margin:0;padding:0}body{background-color:var(--bg-color);font-family:Segoe UI,Roboto,Arial,sans-serif;color:var(--text-color);-webkit-font-smoothing:antialiased}.main-container{max-width:1100px;margin:0 auto;padding:0 20px 60px}.section-wrapper{margin-bottom:50px}.section-title{font-size:1.4rem;font-weight:700;color:var(--epsic-blue);margin-bottom:20px;padding-bottom:8px;border-bottom:2px solid #e9ecef}.grid-container{display:grid;grid-template-columns:repeat(auto-fill,minmax(260px,1fr));gap:20px}.card-link{display:flex;align-items:center;background-color:var(--card-bg);padding:16px 20px;border:1px solid var(--border-color);border-radius:6px;text-decoration:none;transition:all .2s ease-in-out}.card-link:hover{border-color:var(--epsic-blue);background-color:#fcfcfc;transform:translateY(-2px)}.card-logo{width:32px;height:32px;object-fit:contain;margin-right:15px}.card-emoji{font-size:24px;width:32px;height:32px;display:flex;align-items:center;justify-content:center;margin-right:15px}.card-text{font-size:1rem;font-weight:600;color:var(--text-color)}.card-link:hover .card-text{color:var(--epsic-blue)}@media(max-width:600px){.grid-container{grid-template-columns:1fr}}header{background-color:#fff;padding:40px 20px;display:flex;flex-direction:column;align-items:center;justify-content:center;text-align:center;border-bottom:1px solid #e0e0e0;margin-bottom:40px}header img{height:70px;width:auto;margin-bottom:15px;object-fit:contain}.subtitle{color:#003f87;font-size:1.1rem;font-weight:500;margin:0 0 25px}header button{background-color:#003f87;color:#fff;border:none;padding:12px 24px;font-size:.95rem;font-weight:600;border-radius:4px;cursor:pointer;transition:background-color .2s ease}header button:hover{background-color:#002a5c}</style>
